Failable Init
Introduction
Welcome to Lesson 2 of The UIKIt Fundamentals Part 1 Object Oriented Programming. In this lesson you are going learn how to design an init method that, first, possibly returns no object and, second, even throw an error using error handling. I understand it sounds quite confusing to you right now. So, let's dive into it.
Lecture Notes
Problem
Can initialzation fail? Okay, how?
class Product {
  let name: String
  init?(name: String) {
    if name.isEmpty { return nil }
    self.name = name
  }
}

// Always return optional value
// Show the website
var iOSGeeKCommunity = Product(name: "iOS Geek Community")
var myNewProduct = Product(name: "")

print(myNewProduct)
myNewProduct?.name
print(iOSGeeKCommunity?.name)

Error Handling
// Second Part: Throwing Error
enum NameError: Error {
  case noName // more than 10 legs
}

struct UdemyCourse {
  let courseName: String

  init(name: String) throws {
    if name == "" {
      throw NameError.noName
    }
    self.courseName = name
  }
}

Handle Error
do {
  let myCourse = try UdemyCourse(name: "Bob")
  myCourse.courseName

} catch NameError.noName {
  print("Bob, please enter the name")
}

// try? --> if error thrown, automatically returns nil
var hello = try? UdemyCourse(name: "Bob Lee")

// try! --> If error thrown, automiatcally crash
//try! Insect(enterNumber: 12423)

